import { View } from 'react-native';
import { Screens } from '../types'
import type { Id, Screen } from '../types';
import { NavigationProp } from '../types';


interface TodoDetailsScreenProps extends NavigationProp {
  id?: Id
}

export const TodoDetailsScreen = ({id}: TodoDetailsScreenProps) => {
  return (<View>Todo Details Screen ({id})</View>)
}

const screen: Screen = {
  name: Screens.TodoDetails,
  screen: TodoDetailsScreen
}

export default screen;
